import React from 'react';
function Nav(params) {
    return(
        <nav>
            <div>
                <ul>
                    <li>Products</li>
                    <li>For Teams</li>
                    <li>Support</li>
                </ul>
            </div>
            <div className='div2'>
                <button className='login'>LogIn</button>
                <button className='signup'>SignUp</button>
                <i className='fa fa-search'></i>
            </div>
        </nav>
    );

};export default Nav;
